iza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"32563","type":"Paragraph"},{"attributes":{"text":"Taxa de Crescimento = 0.8495"},"id":"32561","type":"Paragraph"},{"attributes":{"data_source":{"id":"31514"},"glyph":{"id":"31515"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"31516"},"selection_glyph":null,"view":{"id":"31518"}},"id":"31517","type":"GlyphRenderer"},{"attributes":{"source":{"id":"31514"}},"id":"31518","type":"CDSView"},{"attributes":{"line_alpha":0.6,"line_color":"#3288bd","line_dash":[4,4],"line_width":1.5,"x":{"field":"x"},"y":{"field":"y"}},"id":"31543","type":"Line"},{"attributes":{"line_alpha":0.1,"line_color":"#3288bd","line_dash":[4,4],"line_width":2,"x":{"field":"x"},"y":{"field":"y"}},"id":"31516","type":"Line"},{"attributes":{"axis":{"id":"31466"},"dimension":1,"ticker":null},"id":"31469","type":"Grid"},{"attributes":{"overlay":{"id":"31476"}},"id":"31472","type":"BoxZoomTool"},{"attributes":{"items":[{"id":"31982"},{"id":"32015"},{"id":"32045"},{"id":"32077"}],"location":"top_left"},"id":"31981","type":"Legend"},{"attributes":{"label":{"value":"Mantida no \u00daltimo Valor"},"renderers":[{"id":"31961"}]},"id":"31982","type":"LegendItem"},{"attributes":{},"id":"31456","type":"DataRange1d"},{"attributes":{"active_drag":"auto","active_inspect":"auto","active_multi":null,"active_scroll":"auto","active_tap":"auto","tools":[{"id":"31470"},{"id":"31471"},{"id":"31472"},{"id":"31473"},{"id":"31474"},{"id":"31475"},{"id":"31605"}]},"id":"31477","type":"Toolbar"},{"attributes":{},"id":"31471","type":"WheelZoomTool"},{"attributes":{},"id":"31473","type":"SaveTool"},{"attrib
